import React, { Component } from 'react';
import {Text,View,Image} from 'react-native';

class Header2 extends Component {
  render() {
     return(
      <View style={{paddingVertical: 1, alignItems:"center", borderWidth:3}}>
         <View style={{ paddingVertical: 5}}>
          <Text style={{textAlign: 'center', fontWeight: 'bold', fontSize:18 }}>Data</Text> 
        </View>
         <Image
          source={{uri: 'https://i.ibb.co/7QpKsCX/image.png'}}
          style={{width:250, height:50,}}/>
            <View style={{ paddingVertical: 5}}>
          <Text style={{textAlign: 'center', fontWeight: 'bold', fontSize:18 }}>Global & Indonesia</Text> 
        </View>
        
    </View>
    )
  }
};

export default Header2;
